('02501914-7141-4553-b092-c43558bf464f', 'e5de0aa6-5f06-4bad-aa6d-a01dba07c33a', 'विख्यात पुस्तक हम्ज़ानामा, जो अकबर के आदेशानुसार अभूतपूर्व रूप से बड़े पटल पर चित्रित की गई थी, मूल रूप से किस भाषा में लिखी गई थी ?', 'MCQ', 1.00, NULL, 'active', '2023-11-03 20:58:50', '2023-11-03 20:58:50', NULL),
('02f2eea0-6650-4c78-8cf1-e202a4526484', 'e5de0aa6-5f06-4bad-aa6d-a01dba07c33a', 'सूची Ⅰ (कृतिकार) को सूची II (कृति) के साथ सुमेलित कीजिए और सूचियों के नीचे दिए गए कूट का प्रयोग कर सही उत्तर चुनिए : \n\nसूची 1 (कृतिकार):         सूची II (कृति):\nA. महालिंगदेव              1. चन्न बासव पुराण  \nB. नाचना सोमनाथ       2. एकोत्तर सतस्थल \nC. राम राज भूषण         3. उत्तर हरिवंशमु \nD. विरूपाक्ष पंडित        4. वसु चरितमु                         \n', 'MCQ', 1.00, NULL, 'active', '2023-11-03 20:58:02', '2023-11-03 20:58:02', NULL),
('034d5240-49d7-4a26-a574-3e5f275c5930', '1ef6127c-42e2-4464-bbfe-96f3f59bb3a9', 'Consider the following statements. \n\n1. Snow leopard is on the IUCN endangered species list\n2. Dachigam (J&K) is called the snow leopard capital of the world.\n3. Project Snow Leopard has been started in 2009 for the conservation of snow leopard. \n\nWhich of the above statements is correct', 'MCQ', 1.00, NULL, 'active', '2023-11-03 21:58:42', '2023-11-03 21:58:42', NULL),
('03c97efd-66f7-4d61-be18-a3cf7f4b66f1', '9b68491e-c230-4246-919b-4dd83067387e', 'The Battle of Plassey paved the way for the British mastery of Bengal and eventually of the whole of India. Which of the following were the reasons for the Battle of Plassey? 1. Misuse of dastaks by company’s officials in private capacity 2. Fortification of Calcutta 3. Abolition of duties on internal trade by the Nawab 4. Shifting of capital from Murshidabad to Munger Select the correct answer using the code given below:', 'MCQ', 1.00, NULL, 'active', '2023-11-03 16:15:23', '2023-11-03 16:15:23', NULL),
('03df25ac-16f6-4eea-8ac8-90e8c55ac397', 'e5de0aa6-5f06-4bad-aa6d-a01dba07c33a', 'सभी वन्य पादप एवं जन्तु, जो विलुप्त होने के कगार पर हैं, से सम्बन्धित सूचना रखने वाली पुस्तक \'रेड डेटा बुक\' का प्रकाशन निम्नलिखित में से किस एक ने किया है?', 'MCQ', 1.00, NULL, 'active', '2023-11-03 20:18:12', '2023-11-03 20:18:12', NULL),
('03e97f9a-1205-43b6-a766-a90b964c13f6', 'e5de0aa6-5f06-4bad-aa6d-a01dba07c33a', '1962 के भारत-चीन संघर्ष के संबंध में निम्नलिखित कथनों पर विचार कीजिए :\n  \n1. पंडित जवाहरलाल नेहरू ने नवम्बर 1962 में राष्ट्रपति केनेडी से सैन्य सहायता मांगी । \n2. संयुक्त राज्य अमरीका ने चीन के विरुद्ध सहायतार्थ दस C-130 मालवाहक वायुयान तथा B-47 बमवर्षक विमानों के दो स्क्वाड्रन भेजे।  \n3. नवम्बर 1962 में जब जनरल थापर ने अपना त्यागपत्र दिया तब नव-नियुक्त रक्षा मंत्री ने नये सेनाध्यक्ष के लिए जनरल जे. एन. चौधरी के नाम का प्रस्ताव किया ।  \n\nउपर्युक्त कथनों में से कौन सा/से सही है/हैं ?', 'MCQ', 1.00, NULL, 'active', '2023-11-03 20:46:01', '2023-11-03 20:46:01', NULL),
('059680f3-de1a-4377-a8e6-a7fb6cbfbfb9', '9b68491e-c230-4246-919b-4dd83067387e', 'Q6) Consider the following statements: 1. Sufism was initiated as a result of protest against the growing mysticism and asceticism of the Caliphate. 2. Sufi saints interpreted Quran based on their personal experiences. 3. The Sufi s organized communities around a hospice called ‘khanqah’. 4. Chisti order was named after its founder Khwaja Muinuddin Chisti. Which of the statements given above are correct?', 'MCQ', 1.00, NULL, 'active', '2023-11-03 16:13:22', '2023-11-03 16:13:22', NULL),
